ecpairing_inputs:
  _info:
    comment: Various inputs to the bn254_pairing precompile

  env:
    currentCoinbase: 00000000000000000000000000000000c014bace
    currentDifficulty: 0x20000
    currentGasLimit: 15000000
    currentNumber: 1
    currentTimestamp: 1000

  expect:
    - indexes:
        data: :label positive
        gas: !!int -1
        value: !!int -1
      network:
        - ">=Cancun"
      result:
        000000000000000000000000000000000000c0de:
          storage:
            01: 1
    - indexes:
        data: :label negative
        gas: !!int -1
        value: !!int -1
      network:
        - ">=Cancun"
      result:
        000000000000000000000000000000000000c0de:
          storage:
            01: 0
    - indexes:
        data:
          - :label invalid_g1_point
          - :label invalid_g2_point
          - :label invalid_g2_subgroup
        gas: !!int -1
        value: !!int -1
      network:
        - ">=Cancun"
      result:
        000000000000000000000000000000000000c0de:
          storage:
            01: 0xfe

  pre:
    00000000000000000000000000000000c014bace:
      nonce: 1
      balance: 0
      code: ''
      storage: { }

    000000000000000000000000000000000000c0de:
      nonce: 0
      balance: 0
      code: |
        :yul shanghai
        {
          let size := calldatasize()
          calldatacopy(0, 0, size)
          let status := staticcall(0xffffffff, 8, 0, size, 0, 0x20)
          let result := 0xfe
          if status {
            result := mload(0)
          }
          sstore(1, result)
        }
      storage:
        01: 0xcc  # placeholder for the result

    a94f5374fce5edbc8e2a8697c15331677e6ebf0b:
      nonce: 0
      balance: 1000000000000000000
      code: ''
      storage: { }

  transaction:
    to: 000000000000000000000000000000000000c0de
    nonce: 0
    gasPrice: 10
